  \"Gaseous Helium Reclamation at Rocket Test Systems Project\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T22:36:19.724691\",\n\t\"name\": \"gaseous-helium-reclamation-at-rocket-test-systems-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The ability to restore large amounts of
  vented gaseous helium (GHe) at rocket test sites preserves the GHe and reduces operating
  cost.  The used GHe is vented into the atmosphere, is non-recoverable, and costs
  NASA millions dollars per year.  Helium, which is non-renewable and irreplaceable
  once released into the atmosphere, is continuously consumed by rocket test facilities
  at NASA centers such as KSC, SSC, and CCAFS at a rate of more than 6.6 Mscf per
  year.  This use is projected to increase to more than 10 Mscf by the year 2018,
  assuming the same inefficient and costly operating procedures and facilities continue
  to be used.  Given the decrease in the world's supply of helium, NASA is heading
  toward to an economic, operational, and programmatic disaster.  New and highly innovative
  approaches are required to drive down launch operation life cycle costs.  Scaling-up
  of existing systems to meet an increased demand of helium is not an option.  Our
  team, Sierra Lobo, Inc. and University of Hawaii at Manao, proposes the use of PEM
  fuel cells to remove most of the impure oxygen and hydrogen in the helium gas stream.
  \ The small traces of oxygen and hydrogen impurities in the GHe will be removed
  by cryo-separation using commercial cryocoolers.\",\n\t\"license_title\": \"U.S.
